import React from 'react';
import styles from '../navbar/Navbar.module.css'
const Types = ({types, selectedTypeId, setType}) => {
    return (
        <div>
            {types.map(type => (
                <div key={type.id}
                     onClick={() => setType(type)}
                    className={type.id == selectedTypeId ? styles.item + ' ' + styles.active : styles.item}>
                    {type.name}
                </div>
            ))}
        </div>
    );
};

export default Types;
